function confirmThenGoToUrl(event,url) {
    event.preventDefault();
    bootbox.confirm({
        message: clx.i18n.are_you_sure,
        buttons: {
            confirm: {
                label: clx.i18n.yes,
                className: 'btn-success'
            },
            cancel: {
                label: clx.i18n.no,
                className: 'btn-danger'
            }
        },
        callback: function (result) {
            if(result)
            {
                window.location = clx.base_url + url;
            }
        }
    });
}